import React from 'react'
import products from "../products"
import {Row,Col} from 'react-bootstrap'


const homescreen = () => {
  return (
    <>
    <Row>
        {products.map(products => {
                <Col>
                <h3>{products.name}
                    </h3></Col>
            })}
      
    </Row>
    </>
  )
}

export default homescreen
